const initialState = {
  dueDate: null,
  plateNumber: null,
};

export const GUEST_REGIST_REQUEST = `GUEST_REGIST_REQUEST`;

const reducers = (state = initialState, action) => {
  switch (action.type) {
    case GUEST_REGIST_REQUEST: {
      return {
        ...state,
        dueDate: action.data.dueDate,
        plateNumber: action.data.plateNumber,
      };
    }
    default: {
      return {
        ...state,
      };
    }
  }
};

export default reducers;
